function ActionLink() {
    function handleClick(e) {
      e.preventDefault();
      console.log('Была нажата ссылка.');
    }
  
    return (
      <a href="https://youtu.be/jfRE0_beZ3s" onClick={handleClick}>
        Нажми на меня
      </a>
    );
  }

  export default ActionLink;
